Let’s first talk about the API of the toy database. The database’s API consists of the following methods: set_time begin_txn write read read_without_txn abort_txn commit_txn run_txn Here is an example of using the database: let db = DB::new("./tmp/data", Timestamp::new(10))
let txn1 = db.begin_txn().await;
let value = db.read::<i32>("foo", txn1).await.unwrap();
if value == "bar" { db.write("baz", 20, txn1).await.unwrap();
}
let commit_result = db.commit_txn(txn1).await; In the code snippet above, we created a database by providing a path to specify where to store the records. We then began a transaction, performed a write and a read, then committed the transaction. An alternative way to perform transactions is with the run_txn method. In the snippet below, the run_txn function automatically begins a transaction and commits the transaction at the end of the function scope. It would also abort the transaction if the inner function panics. db.run_txn(|txn_context| async move { let value = txn_context.read::<i32>("foo").await; if value == "bar" { txn_context.write("foo", 12).await.unwrap(); }
}) For more examples, feel free to check out the unit tests I wrote for my database.

