The database is thread-safe. If you wrap the database instance around an Arc, you can safely use it across different threads. For example: let db = Arc::new(DB::new("./tmp/data", Timestamp::new(10))); let db_1 = Arc::clone(db);
let key1 = "foo";
let key2 = "bar";
let task_1 = tokio::spawn(async move { db_1.run_txn(|txn_context| async move { txn_context.write(key1, 1).await.unwrap(); txn_context.write(key2, 10).await.unwrap(); }) .await
}); let db_2 = Arc::clone(db);
let task_2 = tokio::spawn(async move { db_2.run_txn(|txn_context| async move { txn_context.write(key1, 2).await.unwrap(); txn_context.write(key2, 20).await.unwrap(); }) .await;
});
tokio::try_join!(task_1, task_2).unwrap(); In the example above, the serializability of the database guarantees that either all of task1 is executed first or all of task2 is executed first.

