Earlier, we covered how MVCC works here . In this section, we will talk about how the MVCC layer is implemented. In my MVCC database, HLC (hybrid logical clock) timestamps are used to distinguish different versions of the same key. A key with a timestamp is called an MVCCKey . An MVCCKey is a combination of a Timestamp and a Key: pub struct MVCCKey { pub key: Key, pub timestamp: Timestamp,
} The timestamp’s structure is: pub struct Timestamp { pub wall_time: u64, pub logical_time: u32,
} The Key’s type is pub type Key = Vec<u8>; The database uses RocksDB as the storage engine. We need to encode the MVCCKey into a RocksDB key. Inspired by CockroachDB EncodeMVCCKey method , the MVCCKey is encoded into the following form: [key] [wall_time] [logical_time] Here is the implementation: pub fn encode_mvcc_key(mvcc_key: &MVCCKey) -> Vec<u8> { let mut key_vec = mvcc_key.key.to_vec(); let timestamp_vec = encode_timestamp(mvcc_key.timestamp); key_vec.extend(timestamp_vec); key_vec
} pub fn encode_timestamp(timestamp: Timestamp) -> Vec<u8> { let mut wall_time_bytes = timestamp.wall_time.to_le_bytes().to_vec(); let logical_time_bytes = timestamp.logical_time.to_le_bytes().to_vec(); wall_time_bytes.extend(logical_time_bytes); wall_time_bytes
} Earlier, we covered that a write intent is stored to represent uncommitted writes. A key can only have one write intent at a time. We use the MVCCKey with the zero timestamp: Timestamp { wall_time: 0, logical_time: 0 } to represent the key for a write intent. When users query for a key, the database returns the latest version of that key. To make this faster, MVCCKeys are sorted from highest timestamp to the lowest timestamp in the storage engine, with the exception of the zero timestamp which is stored before all other versions of the same key. This is only possible because RocksDB allows developers to customize the order of keys in the table through set_comparator . Here is my implementation of the custom comparator. The comparator gives the highest precedence to the zero timestamp for the same key. Otherwise, it uses the key and the timestamp to order the MVCC keys.
